import React from 'react';

const FormDataDisplay = ({ formData }) => {
  return (
    <div>
      <h2>Dados do formul√°rio enviados:</h2>
      <p>
        <strong>Nome:</strong> {formData.name}
      </p>
      <p>
        <strong>E-mail:</strong> {formData.email}
      </p>
      <p>
        <strong>Tipo de Solicita√ß√£o:</strong> {formData.requestType}
      </p>
      {formData.requestType === 'Projeto Vendido' && (
        <>
          <p>
            <strong>Nome do Projeto:</strong> {formData.projectName}
          </p>
          <p>
            <strong>Nome do Cliente:</strong> {formData.clientName}
          </p>
          <p>
            <strong>CNPJ:</strong> {formData.cnpj}
          </p>
          <p>
            <strong>Nome do Vendedor:</strong> {formData.vendorName}
          </p>
          <p>
            <strong>Sponsor do Projeto:</strong> {formData.sponsor}
          </p>
          <p>
            <strong>Projeto √© proveniente de um parceiro Inovacode?</strong> {formData.isPartner}
          </p>
          <p>
            <strong>Expectativa do cliente para o t√©rmino do projeto:</strong> {formData.projectTimeline}
          </p>
          <p>
            <strong>Solu√ß√£o Solicitada:</strong> {formData.requestedSolution}
          </p>
          <p>
            <strong>Contexto de Aplica√ß√£o:</strong> {formData.applicationContext}
          </p>
          <p>
            <strong>Haver√° integra√ß√£o com o ERP?</strong> {formData.erpIntegration}
          </p>
          {formData.erpIntegration === 'SIM' && (
            <p>
              <strong>Nome do ERP:</strong> {formData.erpName}
            </p>
          )}
          <p>
            <strong>Proposta Comercial Anexada:</strong> {formData.proposalAttachment}
          </p>
          <p>
            <strong>Edital do Projeto Anexado:</strong> {formData.projectBidAttachment}
          </p>
          <p>
            <strong>O projeto possui contrato?</strong> {formData.hasContract}
          </p>
          {formData.hasContract === 'J√Å FOI SOLICITADO' && (
            <div id="elaborarContratoDiv">
              <a href="https://docs.google.com/document/d/1qJH6BcBsEOk__X3F8V2KAIS3z2BmnqG7/edit?usp=share_link&ouid=110475971778171162377&rtpof=true&sd=true" className="elaborarContratoButton">Elaborar Contrato</a>
            </div>
          )}
          {formData.hasContract === 'SIM' && (
            <p>
              <strong>Contrato Anexado:</strong> {formData.contractAttachment}
            </p>
          )}
        </>
      )}
      {formData.requestType === 'Venda somente de hardwares' && (
        <>
          <p>
            <strong>Nome da Empresa:</strong> {formData.companyName}
          </p>
          <p>
            <strong>CNPJ do Cliente:</strong> {formData.cnpj}
          </p>
          <p>
            <strong>Nome do Vendedor:</strong> {formData.vendorName}
          </p>
          <p>
            <strong>Valor Total Vendido:</strong> {formData.totalValue}
          </p>
          <p>
            <strong>Proposta Comercial Anexada:</strong> {formData.proposalAttachment}
          </p>
          <p>
            <strong>Observa√ß√µes:</strong> {formData.observations}
          </p>
        </>
      )}
      {formData.requestType === 'Prova de conceito (POC)' && (
        <>
          <p>
            <strong>Descri√ß√£o da POC:</strong> {formData.pocDescription}
          </p>
          <p>
            <strong>Nome do Cliente:</strong> {formData.clientName}
          </p>
          <p>
            <strong>CNPJ do Cliente:</strong> {formData.cnpj}
          </p>
          <p>
            <strong>Representante Comercial:</strong> {formData.salesRepresentative}
          </p>
          <p>
            <strong>Sponsor do Projeto:</strong> {formData.sponsor}
          </p>
          <p>
            <strong>Solu√ß√£o Solicitada:</strong> {formData.requestedSolution}
          </p>
          <p>
            <strong>Data da POC:</strong> {formData.pocDate}
          </p>
          <p>
            <strong>Contexto de Aplica√ß√£o:</strong> {formData.applicationContext}
          </p>
          <p>
            <strong>POC ser√° cobrada do cliente:</strong> {formData.chargeClient}
          </p>
          <p>
            <strong>Proposta Comercial Anexada:</strong> {formData.proposalAttachment}
          </p>
        </>
      )}
    </div>
  );
};

export default FormDataDisplay;
